import ImageAvatars from './ImagesAvatars';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';


class Cover extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }


    render() {
        return (
            <div>
                <NavBar/> 
                <div className='Cover'>
                <Grid container wrap="nowrap"> 
                        <Grid zeroMinWidth >                 
                        <ImageAvatars  className='Avatar'/>                        
                        <Typography noWrap><h1 className='CoverTitle'>David Belmonte</h1></Typography>
                        <Typography noWrap><h3 >DÃ©veloppeur Web Junior Javascript/React</h3></Typography>
                        </Grid>  
                        </Grid>                   
                </div>
            </div>
        );
    }
}

export default Cover;
